def rearrange_max_to_front(A: List[int]) -> List[int]:
    a_max = A[0]
    i_max = 1
    for (i, item) in enumerate(A):
        if abs(item) > abs(a_max) or (abs(item) == abs(a_max) and i < i_max):
            (i_max, a_max) = (i, item)
    A.insert(0, A.pop(i_max))
